const myImage = new Image();
{myImage.src = 
    "data:image/jpeg;base64,";
}

myImage.addEventListener("load", function(){
    const canvas = document.getElementById("canvas1");
    const ctx = canvas.getContext("2d");
    
    canvas.width = 900;
    canvas.height = 750;
    
    ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);

    let particlesArray = [];
    const numberOfParticles = 5000;
    class Particle {
        constructor(){
// To change the affect top to bottom/ left to right / spin in spiral. Ajust the starting X and Y for the desired effect.
    this.x = Math.random() * canvas.width;
    this.y = 0;
    this.speed = 0;
    this.velocity = Math.random() * 3.5;
    this.size = Math.random() * 1.5 + 0.5;
// Particle's will fall over black or darker areas faster, and slower over lighter areas.
        }
        update(){
            this.y += this.velocity;
            if(this.y >= canvas.height){
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }
        }
        draw(){
            ctx.beginPath();
            ctx.fillStyle = "white69";
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx.fill();
        }
    }
    function init(){
        for(let i = 0; i < numberOfParticles; i++){
            particlesArray.push(new Particle);
        }
    }
    init();
    function animate(){
        ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);

        // gives partical's fadding trails 
        ctx.globalAlpha = 0.05;
        ctx.fillStyle = "rgb(0, 0, 0)";
        ctx.fillRect(0, 0, canvas.width, canvas.height);
    
        for(let i = 0; i < particlesArray.length; i++) {
            particlesArray[i].update();
            particlesArray[i].draw();
        }
        requestAnimationFrame(animate);
        // globalAlpha specify transparancy value applied to the shapes and images on the canvas 0 is fully transparent, 1 filled.
    }
    animate();
});